#include <iostream>
#include <vector>
using namespace std;
int main(){
    vector<int> v(1000, 1);
    int sum = 0;
    for(int i = 0; i < v.size(); i++){
        sum = sum + v[i];
    }
    cout << sum << endl;
    return 0;
}

