    for(int i = 0; i < 1000; i++){
        sum += (i * i) + (i * i);
    }
    cout << sum;
    return 0;
}

#include <iostream>
using namespace std;
int fib(int n){
    if(n <= 1) return n;
    return fib(n-1) + fib(n-2);
}
int main(){
    cout << fib(35);
    return 0;
}
